__NUXT_JSONP__("/handmade", (function(a,b,c){return {data:[{story:{name:b,created_at:"2021-03-16T09:24:02.849Z",published_at:c,alternates:[],id:41812961,uuid:"8e07ce59-e359-4985-9069-dc2628389551",content:{_uid:"7a5bcb3b-e517-4046-ba4e-ff49888a0cb2",Title:"Ontstaan, ontworpen en ontwikkeld in Amsterdam. \nDavy & Ørsted een merk met een Amsterdamse heritage en Scandinavische uitstraling.",component:"handmade",content_one:"##### **Stoer, stijlvol en no-nonsense**\nDe Davy & Ørsted is een Amsterdams botenmerk met visie en loopt net even voor op de trends. \n\nStoer, stijlvol en no-nonsense, dat zijn de kenmerken van Davy & Ørsted, een nieuwe generatie sloepen, geheel gemaakt van aluminium. De sloep is zelflozend en 100% onderhoudsvrij.\n\n\n##### **Volledig uitgerust**\nHet klassieke ontwerp zorgt in combinatie met het mat gespoten aluminium voor een bijzonder opvallende en robuuste uitstraling. Natuurlijk biedt Davy & Ørsted u alle comfort en praktische eigenschappen die u van een moderne sloep mag verwachten met een zonnedek, zeer comfortabele kussens en voldoende ruimte om kussens en accessoires vochtvrij en veilig op te bergen.\n\nNaast de standaard meegeleverde opties zijn er tal van mogelijkheden om van uw boot een limited edition te maken. Voor Davy & Ørsted is niets te gek en staan we open voor nieuwe ontwikkelingen. ",content_two:"##### **Behandelingen plan**\nIndien gespoten, krijgt de sloep de volgende behandeling:\n\n- \nZandstralen en schuren\n- \nEtsende beits\n- \nVier tussen- en grondverflagen\n- \nOnderwaterverf\n- \nLaatste matte finish laag\n- \nAlle lagen* zijn 2 componenten op epoxy basis\n\n**De dikte van de verflaag is bijna 900 Mu (ongeveer 8 keer zo dik als autolak).*",content_four:"##### **De finishing touch**\nDe aankleding van de boot is minstens zo belangrijk en minstens zo lastig als het samenstellen van uw boot. De kussens maken de boot af en geven het de uitstraling die precies bij uw smaak aansluit. \n\nDavy & Ørsted biedt uitgebreide keuzemogelijkheden omtrent de bekleding, zodat elke sloep een uniek karakter krijgt. De handgemaakte kussens bestaan uit meerdere lagen schuim en bieden een perfecte ondersteuning. Van sober en strak tot een vrolijk symfonie van kleuren en patronen, het kan allemaal.  \nWilt u spelen met de seizoenen? Met een paar sierkussens in een nieuwe kleur of dessin creëert u gemakkelijk een nieuwe look aan boord.  ",content_three:"##### **Verschillende uitvoeringen**\nDe sloepen zijn verkrijgbaar in 2 modellen met ieder verschillende uitvoeringen, de Crafter **(niet planerend)** en de Raptor **(planerend)**. \n\nNa het succes van de 100% aluminium sloepen introduceert Davy & Ørsted 2 bijzonder sportieve boten, Moonraker en Marshal. De stoere, no-nonsense sportboten hebben ieder hun eigen unieke design, uitstraling en karakter. Deze modellen geven de totale collectie van Davy & Ørsted en krachtige en sportieve uitstraling. \n##### **Diesel, elektrisch of hybride**\nDavy & Ørsted biedt een compleet assortiment motortypen aan. De keuze is aan u om te bepalen waar uw voorkeur naar uit gaat.  De dieselmotor is de bekendste en meest gekozen. Wel zien we steeds vaker de keuze vallen op hybride of zelfs volledig elektrisch. Davy & Ørsted bouwt al sinds 2011 met succes volledig elektrische boten. \n\n\n",calltoactiontext:"***Wilt u geen standaard boot maar iets speciaals, Davy & Ørsted bouwt het! \nWij vertellen u graag meer over de mogelijkheden***",content_one_image:"\u002F\u002Fa.storyblok.com\u002Ff\u002F106943\u002F794x528\u002F92867fe0ca\u002F8d.jpeg",content_two_image:"\u002F\u002Fa.storyblok.com\u002Ff\u002F106943\u002F1182x665\u002F3ffa4afab6\u002F5.jpeg",content_three_image:"\u002F\u002Fa.storyblok.com\u002Ff\u002F106943\u002F1024x768\u002F625d6486aa\u002F8b.jpeg"},slug:b,full_slug:"hand-made\u002F",default_full_slug:a,sort_by_date:a,position:0,tag_list:[],is_startpage:true,parent_id:41812959,meta_data:a,group_id:"bf89ef7d-0d4a-4806-9462-8a9c1a0d6e0a",first_published_at:c,release_id:a,lang:"default",path:a,translated_slugs:[]}}],fetch:{},mutations:[]}}(null,"hand-made","2021-03-17T14:32:34.829Z")));